import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div>
            <h1>Bus Tracking System</h1>
            <div>
                <Link to="/driver-login"><button>Driver Access</button></Link>
                <Link to="/student-login"><button>Student Access</button></Link>
            </div>
        </div>
    );
};

export default HomePage;
